import React from 'react'

export default function TasksList({ tasks }) {
  return (
    <ul className="list-group text-white">
      {tasks && tasks.length
        ? tasks.map((t, i) => (
          <li key={i} className="list-item">
            <span>Subject: {t.subject}</span>
            <span>Message: {t.message}</span>
            {t.answer && <span>Answer: {t.answer}</span>}
          </li>
        )) : <div className="h1 text-center text-info">No tasks...</div>}
    </ul>
  )
}
